import React, { Component } from 'react';

//props :
// tabs
class Tabs extends Component {
    render() { 
        return (
            <React.Fragment>
                {
                    this.props.tabs.map(tab => (
                        <div class="tab">
                            <Tab 
                            description = { tab.description }/>

                        </div>
                    ))
                }

            </React.Fragment>
        );
    }
}

export default Tabs;
